// components/Navbar.js
import React from 'react';
import { Link } from 'react-router-dom';

const Navbar = () => {
  return (
    <nav>
      <ul>
        
        <li>
          <Link to="/login">About</Link>
        </li>
        
      </ul>
    </nav>
  );
};

export default Navbar;
